def get_binary_file_downloader_html(bin_data, file_label='File', file_name='file.xlsm'):
    bin_str = base64.b64encode(bin_data).decode()
    href = f'<a href="data:application/vnd.ms-excel.sheet.macroEnabled.12;base64,{bin_str}" download="{file_name}">üì• {file_label}</a>'
    return href

def load_template(file_content):
    """template.xlsm „ÇíË™≠„ÅøËæº„ÇÄÈñ¢Êï∞"""
    try:
        file_stream = io.BytesIO(file_content)
        template_wb = load_workbook(file_stream, keep_vba=True)
        if len(template_wb.sheetnames) < 2:
            st.error("„Ç®„É©„Éº: „ÉÜ„É≥„Éó„É¨„Éº„Éà„Å´„ÅØÊúÄ‰Ωé2„Å§„ÅÆ„Ç∑„Éº„Éà„ÅåÂøÖË¶Å„Åß„Åô")
            return None
        return template_wb
    except Exception as e:
        st.error(f"„ÉÜ„É≥„Éó„É¨„Éº„Éà„Éï„Ç°„Ç§„É´„ÅÆË™≠„ÅøËæº„Åø„Ç®„É©„Éº: {str(e)}")
        st.error(traceback.format_exc())
        return None

def load_additional_data(file_content):
    """Âà©Áî®ÊòéÁ¥∞Êõ∏„ÅÆExcel„Éï„Ç°„Ç§„É´„ÇíË™≠„ÅøËæº„ÇÄÈñ¢Êï∞"""
    try:
        file_stream = io.BytesIO(file_content)
        data_wb = load_workbook(file_stream, keep_vba=True)
        return data_wb
    except Exception as e:
        st.error(f"Âà©Áî®ÊòéÁ¥∞Êõ∏„ÅÆË™≠„ÅøËæº„Åø„Ç®„É©„Éº: {str(e)}")
        st.error(traceback.format_exc())
        return None

def merge_workbooks(template_wb, data_wb):
    """
    Âà©Áî®ÊòéÁ¥∞Êõ∏„ÅÆ„Ç∑„Éº„Éà„Çí„ÉÜ„É≥„Éó„É¨„Éº„Éà„ÉØ„Éº„ÇØ„Éñ„ÉÉ„ÇØ„Å´ËøΩÂä†„Åô„ÇãÈñ¢Êï∞
    „ÉÜ„É≥„Éó„É¨„Éº„Éà„ÅÆ„Ç∑„Éº„Éà„ÅØ„Åù„ÅÆ„Åæ„Åæ„Åß„ÄÅËøΩÂä†„Ç∑„Éº„Éà„ÅØ„ÄåSheet1„Äç„Åã„ÇâÈÄ£Áï™„ÅßÂëΩÂêç
    """
    try:
        template_sheet_names = template_wb.sheetnames.copy()
        st.write(f"Êó¢Â≠ò„ÉÜ„É≥„Éó„É¨„Éº„Éà„Ç∑„Éº„ÉàÔºàÁ∂≠ÊåÅÔºâ: {', '.join(template_sheet_names)}")
        
        # „Éû„ÉÉ„Éî„É≥„Ç∞ÊÉÖÂ†±„ÅØÂÜÖÈÉ®„Åß‰øùÊåÅÔºàË°®Á§∫„ÅØ„Åó„Å™„ÅÑÔºâ
        sheet_name_mapping = {}
        sheet_number = 1
        
        progress_bar = st.progress(0)
        status_text = st.empty()
        
        total_sheets = len(data_wb.sheetnames)
        for idx, sheet_name in enumerate(data_wb.sheetnames):
            progress = int((idx / total_sheets) * 100)
            progress_bar.progress(progress)
            status_text.text(f"Âá¶ÁêÜ‰∏≠... {sheet_name} ({idx+1}/{total_sheets})")
            
            source_sheet = data_wb[sheet_name]
            new_sheet_name = f"Sheet{sheet_number}"
            sheet_number += 1
            
            while new_sheet_name in template_wb.sheetnames:
                new_sheet_name = f"Sheet{sheet_number}"
                sheet_number += 1
            
            sheet_name_mapping[sheet_name] = new_sheet_name
            
            target_sheet = template_wb.create_sheet(title=new_sheet_name)
            
            for i, col in enumerate(source_sheet.columns, 1):
                col_letter = openpyxl.utils.get_column_letter(i)
                if col_letter in source_sheet.column_dimensions:
                    target_sheet.column_dimensions[col_letter].width = source_sheet.column_dimensions[col_letter].width
            
            for i, row in enumerate(source_sheet.rows, 1):
                if i in source_sheet.row_dimensions:
                    target_sheet.row_dimensions[i].height = source_sheet.row_dimensions[i].height
            
            for row in source_sheet.rows:
                for cell in row:
                    if isinstance(cell, openpyxl.cell.cell.Cell):
                        target_cell = target_sheet.cell(row=cell.row, column=cell.column)
                        target_cell.value = cell.value
                        
                        if cell.has_style:
                            target_cell.font = copy(cell.font)
                            target_cell.border = copy(cell.border)
                            target_cell.fill = copy(cell.fill)
                            target_cell.number_format = cell.number_format
                            target_cell.protection = copy(cell.protection)
                            target_cell.alignment = copy(cell.alignment)
            
            for merged_range in source_sheet.merged_cells.ranges:
                target_sheet.merge_cells(str(merged_range))
        
        progress_bar.progress(100)
        status_text.text("Âá¶ÁêÜÂÆå‰∫ÜÔºÅ")
        
        return template_wb
    
    except Exception as e:
        st.error(f"„ÉØ„Éº„ÇØ„Éñ„ÉÉ„ÇØ„ÅÆ„Éû„Éº„Ç∏„Ç®„É©„Éº: {str(e)}")
        st.error(traceback.format_exc())
        return None

